bio:
Ik heb ruime ervaring in fiscale advisering op het gebied van vennootschapsbelasting in de sectoren woningcorporaties, zorg en de publieke sector, alsmede (groot) mkb. Daarbij ben ik tax accounting specialist en ondersteun en adviseer ik bij het opstellen en controleren van fiscale posities in de jaarrekening.

Ik ben gespecialiseerd in fiscale advisering in de sector gezondheidszorg (zowel ziekenhuizen, jeugdzorg, Ggz als V&V instellingen), onder andere op het gebied van:
- herstructureringen en samenwerking (o.a. in het kader van het IZA en Juiste zorg op de juiste plaats);
- toetsing zorgvrijstelling;
 -(voorkomen)vennootschapsbelastingplicht;
- ANBI- status;
- Wet minimumbelasting.

Voorts ben ik gespecialiseerd in fiscale advisering van woningcorporaties op het gebied van:
- herstructurering (bijv. juridische fusie)
- optimalisatiemogelijkheden;
- fiscale positie in de jaarrekening
en ondersteunen wij bij het opstellen en het indienen van de aangifte vennootschapsbelasting.

Mijn werkzaamheden in de publieke sector en het MKB zijn heel breed, met name vanwege de diversiteit van de organisaties. Of het nu gaat om de beoordeling of een organisatie √ºberhaupt vennootschapsbelastingplichtig is (publieke sector), of om de vennootschapsbelastingpositie in de fiscale aangifte te verwerken, ik ondersteun daarbij graag.
